import React from 'react';
import Button from './UI/Button/Button';
import GcPic from './assets/GcPic.jpeg';

function Home () {
    return (
        <div>
            <img className={'hero'} src = {GcPic}> </img>
            <Button />
        </div>
    )
}
export default Home;
